<template>
  <q-page padding style="max-width: 800px; margin: 0 auto">
    <q-img
      :src="null"
      placeholder-src="data:image/png;base64,"
    ></q-img>
    <div v-if="highlighted.length"  style="heigh: 0; overflow: hidden; padding-top: 50%;" class="relative-position q-mb-md">
      <div class="fit absolute-top-left">
        <q-carousel
          animated
          v-model="slide"
          height="100%"
          autoplay
          :arrows="highlighted.length > 1"
          :infinite="highlighted.length > 1"
        >
          <q-carousel-slide
            v-for="(image, index) in highlighted"
            :key="`slide_${index}`"
            :name="index"
            :img-src="`http://localhost:3000/upload/listing/image?image_id=${image.image_id}`"
          >
            <div
              @click="$router.push(`/listing/${image.listing.listing_id}`)"
              class="cursor-pointer absolute-bottom text-center q-pa-sm text-white"
              style="background: rgba(0, 0, 0, 0.47)">
              <div class="text-h3">{{image.listing.public_name}}</div>
              <div class="text-subtitle1">{{image.listing.description}}</div>
            </div>
          </q-carousel-slide>
        </q-carousel>
      </div>
    </div>
    <q-list>
      <q-item
        v-for="(listing, index) in listings"
        :key="index"
        clickable
        :to="`/listing/${listing.listing_id}`"
      >
        <q-item-section>
          <q-item-label :lines="1">
            {{listing.public_name}}
          </q-item-label>
          <q-item-label caption :lines="2">
            {{listing.description}}
          </q-item-label>
        </q-item-section>
        <q-item-section side>
          BS {{getListingPrice(listing)}}
        </q-item-section>
      </q-item>
    </q-list>
    <q-inner-loading :showing="loading">
      <q-spinner></q-spinner>
    </q-inner-loading>
  </q-page>
</template>

<script>

export default {
  name: 'Listings',
  data () {
    return {
      slide: 0,
      loading: false,
      listings: [],
      highlighted: []
    }
  },
  methods: {
    getListingPrice (listing) {
      return listing.listing_products.reduce((subtotal, { price, quantity }) => subtotal + ((price / 100) * quantity), 0).toFixed(2)
    },
    async loadAvailableListings () {
      const query = /* GraphQL */`
        query {
          highlighted: store_listing_image (where: { highlighted: { _eq: true }, listing: { available_listing: {} } }) {
            name
            image_id
            listing {
              listing_id
              public_name
              description
              listing_products {
                quantity
                price
              }
            }
          }
          listings: store_listing (where: { available_listing: { listing_id: { _is_null: false } } }) {
            listing_id
            public_name
            description
            listing_products {
              quantity
              price
            }
          }
        }
      `
      try {
        this.loading = true

        const { listings, highlighted } = await this.$gql(query)
        this.highlighted = highlighted
        this.listings = listings
      } catch (error) {
        this.$gql.handleError(error)
      } finally {
        this.loading = false
      }
    }
  },
  mounted () {
    this.loadAvailableListings()
  }
}
</script>

